import React from 'react';

import classes from './UserProfileSwitchBar.module.css';
import UserProfileSwitchBarButton from './UserProfileSwitchBarButton';


const UserProfileSwitchBar=(props)=>{


let Basic="Basic";
let Advanced="Advanced";
let Grades="Grades";



return(

<div className={classes.userProfileSwitchBar}>


<UserProfileSwitchBarButton onPress={props.onPressBasic} title={Basic} style={{color:"white",backgroundColor:"#7097e0"}}/>

<UserProfileSwitchBarButton onPress = {props.onPressAdvanced} title={Advanced}/>	

<UserProfileSwitchBarButton onPress = {props.onPressGrades} title={Grades}/>

</div>

);



}


export default UserProfileSwitchBar;
